import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const Step2 = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    const fetchVehicles = async () => {
      try {
        // Replace with actual API call
        const response = {
          data: {
            available_vehicles: [
              {
                id: 1,
                year: 2023,
                number_seats: 5,
                number_doors: 4,
                large_bags: 2,
                small_bags: 3,
                odometer: 50000,
                mark: 'Toyota',
                group: 'SUV',
                color: {
                  title: 'Red',
                  code: '#FF0000'
                },
                type: 'Car',
                body_type: 'SUV',
                min_price: 50,
                price: 100,
                status: 'Available',
                currency: 'USD',
                consumption: '10L/100km',
                fuel: 'Petrol',
                volume_tank: '60L',
                volume_engine: '2.0L',
                transmission: 'Automatic',
                options: [
                  { id: 1, name: 'GPS', icon: 'gps-icon.png' },
                  { id: 2, name: 'Bluetooth', icon: 'bluetooth-icon.png' }
                ],
                thumbnail: 'toyota-thumbnail.jpg',
                thumbnails: ['toyota-thumbnail.jpg', 'toyota-thumbnail2.jpg'],
                photos: ['toyota-photo1.jpg', 'toyota-photo2.jpg'],
                custom_fields: {},
                wheel_drive: '4WD',
                registration_number: 'AB 1234',
                total_price: 200,
                price_before_discount: 150,
                count_days: 2,
                refill: 'Full',
                mileage_limit: 'Unlimited'
              }
              // Add more vehicle objects as needed
            ]
          }
        };

        // Parse the available vehicles from the response
        const availableVehicles = response.data.available_vehicles;

        // Store the parsed vehicles in the state
        setVehicles(availableVehicles);
      } catch (error) {
        console.error('Error fetching vehicles:', error);
        setError('Failed to fetch vehicles: ' + error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchVehicles();
  }, []);

  return (
    <div className="step2">
      <div className="catalog">
        <h2>Available Vehicles</h2>
        {loading && <p>Loading...</p>}
        {error && <p>{error}</p>}
        {!loading && !error && vehicles.length === 0 && <p>No vehicles available</p>}
        {!loading && !error && vehicles.length > 0 && (
          <div className="vehicle-list">
            {vehicles.map(vehicle => (
              <div key={vehicle.id} className="vehicle-item">
                <div className="vehicle-thumbnail">
                  {vehicle.photos.map((photo, index) => (
                    <img key={index} src={photo} alt={`${vehicle.mark}`} />
                  ))}
                </div>
                <div className="vehicle-details">
                  <h3>{`${vehicle.mark}`}</h3>
                  <p>ID: {vehicle.id}</p>
                  <p>Year: {vehicle.year}</p>
                  <p>Number of Seats: {vehicle.number_seats}</p>
                  {/* Render other vehicle details as needed */}
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Step2;
